import createLucideIcon from '../createLucideIcon';

const Clock5 = createLucideIcon('Clock5Icon', [
  ['circle', { cx: '12', cy: '12', r: '10', key: '1mglay' }],
  ['polyline', { points: '12 6 12 12 14.5 16', key: '1pcbox' }],
]);

export default Clock5;
